    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Valentine NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Valentine NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a summary of Refuge resources, information
    on the management direction, and implementation and monitoring strategies. Key planning
    issues include: bison reintroduction, black-tailed prairie dog introduction, prescribed
    burns, wildlife protection, public use, fisheries management, and funding.",nt"license_title":
